import React from 'react';

import './styles/global.css'

import logoImg from './images/logo_git.svg'

function App() {
  return (
    <div className="App">
      <div className="apresentation">
        <img id = "logo" src={logoImg} alt="Github icon by Dave Gandy"/>
        <h1>Github Search</h1>
      </div>
    </div>
  );
}

export default App;
